    @Test
    public void hacerExcelTest() throws DAOException, ExcelBuildException {
        String str = getJsonTenenciasViewMock();
        TenenciasView tenenciasView = null;
        TenenciasDetalleView tenenciasDetalleView = new TenenciasDetalleView();
        String strTDTO = getJsonTenenciasDTOMock();
        List<PlazoFijoDTO> pfdto = getPFDTO();
        
        ObjectMapper mapper = new ObjectMapper();
        mapper.disable(DeserializationConfig.Feature.FAIL_ON_UNKNOWN_PROPERTIES);
        mapper.configure(JsonParser.Feature.ALLOW_UNQUOTED_FIELD_NAMES, true);
        try {
            tenenciasView = mapper.readValue( str , TenenciasView.class);
            pfdto = mapper.readValue( strTDTO , new TypeReference<List<PlazoFijoDTO>>(){});
        } catch (JsonParseException e) {
            throw new DAOException();
        } catch (JsonMappingException e) {
            throw new DAOException();
        } catch (IOException e) {
            throw new DAOException();
        } catch (Exception e) {
            throw new DAOException();
        }
        InversionesView inversionesView = new InversionesView();
        InversionesHelper.agregarPlazoFijos(inversionesView, pfdto, new ArrayList<FirmanteView>());
        
                
        TendenciasExcelEntity tendenciasExcelEntity = new TendenciasExcelEntity();
        TenenciasExcelView tenenciasExcelView = new TenenciasExcelView();
        tenenciasExcelView.setAnio("2018");
        tenenciasExcelView.setResumen(respuestaFactory.crearRespuestaOk(tenenciasView));
        tenenciasExcelView.setDetalle(respuestaFactory.crearRespuestaOk(tenenciasDetalleView));
        tendenciasExcelEntity.setTenenciasExcelView(tenenciasExcelView);

        byte[] excel = teneciasExcelBuilderHelper.hacerExcel(new Cliente(), tendenciasExcelEntity);
        Boolean writeExcel = Boolean.FALSE;
        if (writeExcel) {
            print(excel, 0);
        }
        assertNotNull(excel);
        
    }


